webpackJsonp([0xc537de157145],{8385:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Working for the Clampdown",date:"25 May 2005",slug:"/2005-05-25-working-for-the-clampdown/",tags:"Y2005"},html:'<p><a href="http://ameisendorf.de/index.php?itemid=326" title="ameisendorf.de: Das Jammern hat sich gelohnt">Thorte\'s post on the new elections</a> reminded me of the fact that if we were playing <a href="http://aries.mos.org/sixdegrees/">six degrees of separation</a> with German politicians, I\'d be closest to Bavarian Interior Minister <a href="http://de.wikipedia.org/wiki/G%C3%BCnther_Beckstein">G&uuml;nther Beckstein</a>, the most right-wing politician holding high office in Germany. That might be enough to save my butt when the <a href="http://www.plyrics.com/lyrics/theclash/clampdown.html">clampdown</a> comes, but I doubt if I\'d be able to help anyone else.</p>'},next:{fields:{title:"You say you want a revolution",date:"23 May 2005",slug:"/2005-05-23-you-say-you-want-a-revolution/"}},previous:{fields:{title:"When Exceptions Become the Norm",date:"27 May 2005",slug:"/2005-05-27-when-exceptions-become-the-norm/"}}},{node:{fields:{title:"You say you want a revolution",date:"23 May 2005",slug:"/2005-05-23-you-say-you-want-a-revolution/",tags:"Y2005"},html:'<p><a title="powerbook _ blog" href="http://powerbook.blogger.de/">powerbook_blog</a>, who normally blogs almost exclusively about his (surprise) Powerbook, <a href="http://powerbook.blogger.de/stories/277548/" title="powerbook _ blog: [blog]impact NRW Wahl - der Tag danach">makes the observation</a> that the NRW elections and Schr&ouml;der\'s decision to call new elections could be the best thing to ever happen to the German blogosphere. I paraphrase: "In my 1 year blogging career I\'ve never seen so many political blog postings. I would find it almost revolutionary if this would continue. It would be fantistic if we could get a little bit away from our we-can\'t-do-anything-about-it-anyway mentality and blog a little bit about politics."</p>\n<p>What, a revolution? In Germany? Nah, it will never happen...</p>'},next:{fields:{title:"Live Journal Exchange",date:"23 May 2005",slug:"/2005-05-23-live-journal-exchange/"}},previous:{fields:{title:"Working for the Clampdown",date:"25 May 2005",slug:"/2005-05-25-working-for-the-clampdown/"}}},{node:{fields:{title:"Live Journal Exchange",date:"23 May 2005",slug:"/2005-05-23-live-journal-exchange/",tags:"Y2005"},html:'<p><a title="franzi1981: About bloody time!" href="http://www.livejournal.com/users/franzi1981/479498.html">Live Journal exchange on new elections</a> "This is the most sucky government we ever had", "But they also had to deal with all the shit 16 years of fat guy brought us"</p>'},next:{fields:{title:"SPD Loses Big in NRW",date:"22 May 2005",slug:"/2005-05-22-spd-loses-big-in-nrw/"}},previous:{fields:{title:"You say you want a revolution",date:"23 May 2005",slug:"/2005-05-23-you-say-you-want-a-revolution/"}}}],pathPrefix:"",first:!1,last:!1,index:310,pageCount:1101}}}});
